  return (
    <div className={`vertical-sidebar ${isExpanded ? 'expanded' : ''}`}>
      <div 
        className="sidebar-item toggle-button" 
        onClick={toggleSidebar}
      >
        <span className="sidebar-icon">‚â°</span>
