      <Link to="/admin/manage-artworks" className="sidebar-item">
        <span className="sidebar-icon">üñºÔ∏è</span>
        <span className="sidebar-text">Manage Artworks</span>
      </Link>
      <Link to="/admin/site-settings" className="sidebar-item">
        <span className="sidebar-icon">‚öôÔ∏è</span>
        <span className="sidebar-text">Site Settings</span>
      </Link>
      <Link to="/admin/site-settings" className="sidebar-item">
        <span className="sidebar-icon">‚öôÔ∏è</span>
        <span className="sidebar-text">Site Settings</span>
      </Link>
    </div>
  );
};

export default AdminNavbar;
